export class AppFactory {
  constructor(baseUrl) {
    this._baseUrl = baseUrl;
    this.links = {
      root: '/'
    };
  }

  get baseUrl () {
    return this._baseUrl;
  }

  setLink(name, link) {
    this.links[name] = link;
  }
}
